(window.webpackJsonp=window.webpackJsonp||[]).push([[86],{306:function(e){e.exports={data:{posts:{totalCount:74,pageInfo:{totalPages:8,currentPage:4,isFirst:!1,isLast:!1},edges:[{node:{title:"Public Spoken",image:null,path:"/blog/2017/06/15/public-spoken",excerpt:'<p>I did a presentation with the <a href="https://humanist.nz/" target="_blank" rel="nofollow noopener noreferrer">Humanist Society of New Zealand</a>. About 20 people attended, all in a meeting room above a pub in the middle of the city. I’d say it went well, although I’m sure from an outside perspective I was awkwardly squeezing words out of my mouth.</p>\n',date:"2017-06-15T00:00:00.000Z",timeToRead:2}},{node:{title:"Strange",image:null,path:"/blog/2017/06/07/strange",excerpt:"<p>This is the first time in about 12 years that I haven’t been keeping in the loop around E3. Right now I’m playing through the new Shovel Knight expansion and enjoying the mechanics. I still have a stack of Wii U games to get through including Xenoblade Chronicles X, Twilight Princess HD and Kirby and the Rainbow Paintbrush. I’m sure there’ll be many games announced that I’d like to play, but I’m contempt to play them in the far future. And, despite being largely unemployed right now, I just don’t have the will to play through things as much as I used to.</p>\n",date:"2017-06-07T00:00:00.000Z",timeToRead:1}},{node:{title:"Public Speaking",image:null,path:"/blog/2017/05/30/public-speaking",excerpt:"<p>In my effort to gain human contact, last month I attended the monthly meetup for the Humanist Society of New Zealand. I was apprehensive at first, but it ended up being very enjoyable. I got to have great conversations with intelligent people.</p>\n",date:"2017-05-30T00:00:00.000Z",timeToRead:1}},{node:{title:"Today",image:null,path:"/blog/2017/05/25/today",excerpt:"<p>I feel violently awful today and I don’t know why.</p>\n",date:"2017-05-25T00:00:00.000Z",timeToRead:1}},{node:{title:"Times They Are Changing",image:"/media/images/blog/trump.jpg",path:"/blog/2017/05/24/times-they-are-changing",excerpt:"<p>Things generally devalue with age.</p>\n",date:"2017-05-24T00:00:00.000Z",timeToRead:4}},{node:{title:"I have done",image:"/media/images/blog/PiUnit.jpg",path:"/blog/2017/05/21/i-have-done",excerpt:"<p>For a few years I was into a technology culture that is still growing now – the amateur maker scene. A few fortunate events let me turn this into commissioned work.</p>\n",date:"2017-05-21T00:00:00.000Z",timeToRead:3}},{node:{title:"I eat",image:"/media/images/blog/bmi.jpg",path:"/blog/2017/05/19/i-eat",excerpt:"<p>For a while now I’ve just been skipping meals. When high noon or the evening rolls around I just lack motivation to prepare anything worth eating. Cheap things you can buy ready made are always full of salt and fat. Takeaways in this small town are limited to the main burger chains or a giant deep fried smorgasbord.</p>\n",date:"2017-05-19T00:00:00.000Z",timeToRead:2}},{node:{title:"Suicide",image:null,path:"/blog/2017/05/02/suicide",excerpt:"<p>This is a tough subject, a strong taboo in society. But after watching 13 Reason Why I feel urged to write about my perspective on suicide. I found the show very compelling, the writing is excellent and the characters are very well realised. But the road to taking ones own life can take many forms.</p>\n",date:"2017-05-02T00:00:00.000Z",timeToRead:2}},{node:{title:"A Red Jacket",image:"/media/images/blog/me31.jpg",path:"/blog/2017/04/28/a-red-jacket",excerpt:"<p>Ugh.</p>\n",date:"2017-04-28T00:00:00.000Z",timeToRead:2}},{node:{title:"Modification",image:"/media/images/blog/meclosed.jpg",path:"/blog/2017/04/23/modification",excerpt:"<p>Well, my last blog post was a hit. I guess problems with peoples personal lives are still things that illicit empathy, even on a two-bit blog written by an anti-social introvert like me. So I’ll give it another go.</p>\n",date:"2017-04-23T00:00:00.000Z",timeToRead:4}}]}}}}}]);